import {
  createRouter,
  createWebHistory
} from 'vue-router'

//引入布局组件
import Layout from '../views/Layout/index.vue'
const routes = [{
  path: '/',
  name: 'Home',
  redirect: '/login', // 重定向到 /login 路径
  meta: {
    name: '首页'
  },
  component: () => import('../views/Login/Login.vue'),
  children: [
    // 其他子路由
  ]
},
{
  path: '/login',
  name: 'Login',
  hidden: true,
  meta: {
    name: '登录'
  },
  component: () => import('../views/Login/Login.vue')
},
{
  path: '/reg',
  name: 'Reg',
  hidden: true,
  meta: {
    name: '注册'
  },
  //按需加载
  component: () => import('../views/Login/Reg.vue')
},
{
  path: '/:catchAll(.*)',
  name: '404',
  hidden: true,
  meta: {
    name: '404页面'
  },
  //按需加载
  component: () => import('../views/404/404.vue')
},


{
  path: '/equipment',
  name: 'equipment',
  //重定向
  meta: {
    name: '药品管理',
    icon: 'School'
  },
  //控制台
  component: Layout,
  children: [{
    path: '/equipment',
    name: 'equipment',
    meta: {
      name: '器械管理',
    },
    component: () => import('../views/Admin/medicine.vue')
  },]
},
{
  path: '/type',
  name: 'type',
  //重定向
  meta: {
    name: '药品类型管理',
    icon: 'Notebook'
  },
  //控制台
  component: Layout,
  children: [{
    path: '/type',
    name: 'type',
    meta: {
      name: '器械类型管理',
    },
    component: () => import('../views/Admin/medicineType.vue')
  },]
},
{
  path: '/user',
  name: 'user',
  //重定向
  meta: {
    name: '用户管理',
    icon: 'User'
  },
  //控制台
  component: Layout,
  children: [{
    path: '/user',
    name: 'user',
    meta: {
      name: '用户信息',
    },
    component: () => import('../views/Admin/user.vue')
  },]
},
{
  path: '/collect',
  name: 'collect',
  //重定向
  meta: {
    name: '订单管理',
    icon: 'Operation'
  },
  //控制台
  component: Layout,
  children: [{
    path: '/collect',
    name: 'collect',
    meta: {
      name: '收藏',
    },
    component: () => import('../views/Admin/order.vue')
  }]
},

{
  path: '/userIndex',
  name: 'userIndex',
  hidden: true,
  meta: {
    name: '用户端首页'
  },
  component: () => import('../views/User/userIndex.vue')
},
{
  path: '/personal',
  name: 'personal',
  hidden: true,
  meta: {
    name: '个人中心'
  },
  component: () => import('../views/User/personal.vue')
},
{
  path: '/myCollect',
  name: 'myCollect',
  hidden: true,
  meta: {
    name: '我的收藏'
  },
  component: () => import('../views/User/shoppingCart.vue')
},
{
  path: '/detail',
  name: 'detail',
  hidden: true,
  meta: {
    name: '详情'
  },
  component: () => import('../views/User/detail.vue')
},
{
  path: '/test',
  name: 'test',
  hidden: true,
  meta: {
    name: 'test'
  },
  component: () => import('../views/User/test.vue')
},
{
  path: '/medicine',
  name: 'medicine',
  hidden: true,
  meta: {
    name: 'medicine'
  },
  component: () => import('../views/User/medicine.vue')
},
{
  path: '/order',
  name: 'order',
  hidden: true,
  meta: {
    name: 'medicine'
  },
  component: () => import('../views/User/medicine.vue')
},

]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})


export default router
